  id:1,
  title:'First',
  desc:'first desc',
  done:true,
  dueDate: new Date('2020-12-12')
}]
)
setTasks([
  ...tasks
])

function App() {

  return( 
    <div id="tasks">
      <Tasks tasks={tasks}/>    
      <NewTaskForm/>
    </div>
  )
}


export default App;
